package ccxt

type Gateio struct {
	*GateioCore
	Core          *GateioCore
	exchangeTyped *Gate
}

func NewGateio(userConfig map[string]interface{}) *Gateio {
	p := NewGateioCore()
	p.Init(userConfig)
	return &Gateio{
		GateioCore:    p,
		Core:          p,
		exchangeTyped: NewGateFromCore(&(p.GateCore)),
	}
}
func NewGateioFromCore(core *GateCore) *Gate {
	return &Gate{
		GateCore:      core,
		Core:          core,
		exchangeTyped: NewExchangeTyped(&core.Exchange),
	}
}

